import React from 'react';

import { QuestionWrapper, Text, StyledButton } from './styles';

const Question = ({ question, answers, nextQuestion, countQuestion }) => {


  return (


    <QuestionWrapper>
      <Text count>Question: {countQuestion + 1}</Text>
      <Text quest>{question}</Text>

      <StyledButton answer>{answers.answer_a}</StyledButton >
      <StyledButton answer>{answers.answer_b}</StyledButton >
      <StyledButton answer>{answers.answer_c}</StyledButton >
      <StyledButton answer>{answers.answer_d}</StyledButton >
      <StyledButton answer>{answers.answer_e}</StyledButton >
      <StyledButton answer>{answers.answer_f}</StyledButton >


      <button onClick={nextQuestion}> Next</button>


    </QuestionWrapper>


  );
};

export default Question;
